window.bookSummaryJSON = "<p>Mathilda Honeycutt, SuperWitch, Prophesied Savior of The World, has survived the first battle of the Supernatural War.</p> <p>But before she can take a breath, she's deflecting spells from angry witches in her local Target, getting visits from the Federal Witches Agency, and even though she's wearing the perfect outfit, her meeting with the US government doesn't go too well.</p> <p>What's a girl to do when she's got a war to plan, a world to save, and two gorgeous guys still in hot pursuit?</p> <p>She gets on with it, accessorizing perfectly along the way. Even if she's deep in the dungeons of a vampire castle or visiting the faerie realm. </p> <p>But Mathilda, her magical posse, and her hot guys, are racing against the clock.</p> <p>The Dark Lord is rising, and they have to stop him. </p> <p>Or the world as we know it will cease to exist.</p>"; 
